While crossing the street one fine day, a woman agrees to fly off to Africa to be a seedy, stocky photographer&amp;#039;s object de art. After lots of travelogue footage of wildebeests and baboons scratching their juju fruits, the portly picture taker gets the comely lass to strip off her standards and flash her Veldt all over the Dark Continent. As the perfectly perfunctory strangers learn more about each other, mostly in a horizontal mode, it seems that the street pick up is game for just about any jungle adventure?as long as it does not involve being tied up. Apparently that reminds her of being brutally raped as a teenager. After spending far too many minutes down that miscreant memory lane, we learn that our aqua-car traveling tramps (that&amp;#039;s right, they left from France and traveled to Africa by aqua-car) have blown a gasket and cannot leave the crazy Congo without some manner of non-modern methodology.

